import React from 'react';
import './Nav.css';

function Nav(props){
    return (
        <div>
            <div className='navbar'>
                <img className='logo'src={requestAnimationFrame('../img/logo.png')} width="50px">어푸</img>
                <Link className='navbarMenu' to = {'/'}>Main</Link>
                <Link className='navbarMenu' to = {'/about'}>About</Link>
                <Link className='navbarMenu' to = {'/contact'}>Contact</Link>
            </div>
        </div>
    )
}

export default Nav;
